import React from 'react';
import { Card, CardBody, Row, Col, CardImg, CardTitle, CardSubtitle } from 'reactstrap';

const titleCase = str => {
    str = str.toLowerCase();
    var array = str.split(' ');
    for(var c = 0; c < array.length; c++){
        array[c] = array[c][0].toUpperCase() + array[c].substring(1);
    }
    return array.join(' ');
}

const Listing = props => {
    const name = props.info['Name'].replaceAll('-COMMA-', ',')
    const location = props.info['RoomType'] + ' in ' + props.info['Neighborhood']

    return (
        <>
            <Row>
                <Col md={{size: 10, offset: 1}}>
                    <Card>
                        <Row>
                            <Col>
                                <CardImg className="card-img" top src={props.info['PictureURL']} alt="airbnb listing picture" />
                            </Col>
                        </Row>
                        <CardBody>
                            <CardSubtitle tag='h6'>{location}</CardSubtitle>
                            <CardTitle tag='h5'>{titleCase(name)}</CardTitle>
                            <CardText></CardText>
                        </CardBody>
                    </Card>
                </Col>
            </Row>
        </>
    )

}

export default Listing;
